import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  {
    id: "e1",
    title: "Some Event",
  },
  {
    id: "e2",
    title: "Another event",
  },
];

function EventsPage() {
  return <h1>EventsPage</h1>;
  <ul>
    {DUMMY_EVENTS.map(event => <li key={event.id}></li>)}
  </ul>
}

export default EventsPage;
